符串进行切片操作，每两位截取&lt;/span&gt;&lt;br&gt;&lt;span class=&#34;line&#34;&gt;    hex_str_list=[]&lt;/span&gt;&lt;br&gt;&lt;span class=&#34;line&#34;&gt;    for i in range(0,len(str)-1,2):&lt;/span&gt;&lt;br&gt;&lt;span class=&#34;line&#34;&gt;        hex_str=str[i:i+2]&lt;/span&gt;&lt;br&gt;&lt;span class=&#34;line&#34;&gt;        hex_str_list.append(hex_str)&lt;/span&gt;&lt;br&gt;&lt;span class=&#34;line&#34;&gt;    print(&amp;quot;hex列表：%s\n&amp;quot;%hex_str_list)&lt;/span&gt;&lt;br&gt;&lt;span class=&#34;line&#34;&gt;    hex_to_str(hex_str_list)&lt;/span&gt;&lt;br&gt;&lt;span class=&#34;line&#34;&gt;&lt;/span&gt;&lt;br&gt;&lt;span class=&#34;line&#34;&gt;def hex_to_str(hex_str_list):&lt;/span&gt;&lt;br&gt;&lt;span class=&#34;line&#34;&gt;    int_list=[]&lt;/span&gt;&lt;br&gt;&lt;span class=&#34;line&#34;&gt;    dec_list=[]&lt;/span&gt;&lt;br&gt;&lt;span class=&#34;line&#34;&gt;    flag=&amp;#x27;&amp;#x27;&lt;/span&gt;&lt;br&gt;&lt;span class=&#34;line&#34;&gt;    for i in range(0,len(hex_str_list)):#把16进制转化为10进制&lt;/span&gt;&lt;br&gt;&lt;span class=&#34;line&#34;&gt;        int_str=int(&amp;#x27;0x%s&amp;#x27;%hex_str_list[i],16)&lt;/span&gt;&lt;br&gt;&lt;span class=&#34;line&#34;&gt;        int_list.append(int_str)&lt;/span&gt;&lt;br&gt;&lt;span class=&#34;line&#34;&gt;        dec_list.append(int_str-128)#-128得到正确的ascii码&lt;/span&gt;&lt;br&gt;&lt;span class=&#34;line&#34;&gt;    for i in range(0,len(dec_list)):#ascii码转化为字符串&lt;/span&gt;&lt;br&gt;&lt;span class=&#34;line&#34;&gt;        flag += chr(dec_list[i])&lt;/span&gt;&lt;br&gt;&lt;span class=&#34;line&#34;&gt;    print(&amp;quot;转化为十进制int列表：%s\n&amp;quot;%int_list)&lt;/span&gt;&lt;br&gt;&lt;span class=&#34;line&#34;&gt;    print(&amp;quot;-128得到ASCII十进制dec列表：%s\n&amp;quot;%dec_list)&lt;/span&gt;&lt;br&gt;&lt;span class=&#34;line&#34;&gt;    print(&amp;#x27;最终答案：%s&amp;#x27;%flag)&lt;/span&gt;&lt;br&gt;&lt;span class=&#34;line&#34;&gt;&lt;/span&gt;&lt;br&gt;&lt;span class=&#34;line&#34;&gt;if __name__==&amp;#x27;__main__&amp;#x27;:&lt;/span&gt;&lt;br&gt;&lt;span class=&#34;line&#34;&gt;    str=&amp;#x27;d4e8e1f4a0f7e1f3a0e6e1f3f4a1a0d4e8e5a0e6ece1e7a0e9f3baa0c4c4c3d4c6fbb9b2b2e1e2b9b9b7b4e1b4b7e3e4b3b2b2e3e6b4b3e2b5b0b6b1b0e6e1e5e1b5fd&amp;#x27;&lt;/span&gt;&lt;br&gt;&lt;span class=&#34;line&#34;&gt;    print(&amp;quot;字符串长度：%s&amp;quot;%len(str))&lt;/span&gt;&lt;br&gt;&lt;span class=&#34;line&#34;&gt;    hex_str(str)&lt;/span&gt;&lt;br&gt;&lt;/pre&gt;&lt;/td&gt;&lt;/tr&gt;&lt;/table&gt;&lt;/figure&gt;
