lt;/span&gt;&lt;br&gt;&lt;/pre&gt;&lt;/td&gt;&lt;td class=&#34;code&#34;&gt;&lt;pre&gt;&lt;span class=&#34;line&#34;&gt;import zlib&lt;/span&gt;&lt;br&gt;&lt;span class=&#34;line&#34;&gt;import struct&lt;/span&gt;&lt;br&gt;&lt;span class=&#34;line&#34;&gt;import argparse&lt;/span&gt;&lt;br&gt;&lt;span class=&#34;line&#34;&gt;import itertools&lt;/span&gt;&lt;br&gt;&lt;span class=&#34;line&#34;&gt;&lt;/span&gt;&lt;br&gt;&lt;span class=&#34;line&#34;&gt;&lt;/span&gt;&lt;br&gt;&lt;span class=&#34;line&#34;&gt;parser = argparse.ArgumentParser()&lt;/span&gt;&lt;br&gt;&lt;span class=&#34;line&#34;&gt;parser.add_argument(&amp;quot;-f&amp;quot;, type=str, default=None, required=True,&lt;/span&gt;&lt;br&gt;&lt;span class=&#34;line&#34;&gt;                    help=&amp;quot;1.png&amp;quot;)&lt;/span&gt;&lt;br&gt;&lt;span class=&#34;line&#34;&gt;args  = parser.parse_args()&lt;/span&gt;&lt;br&gt;&lt;span class=&#34;line&#34;&gt;&lt;/span&gt;&lt;br&gt;&lt;span class=&#34;line&#34;&gt;&lt;/span&gt;&lt;br&gt;&lt;span class=&#34;line&#34;&gt;bin_data = open(args.f, &amp;#x27;rb&amp;#x27;).read()&lt;/span&gt;&lt;br&gt;&lt;span class=&#34;line&#34;&gt;crc32key = zlib.crc32(bin_data[12:29]) # 计算crc&lt;/span&gt;&lt;br&gt;&lt;span class=&#34;line&#34;&gt;original_crc32 = int(bin_data[29:33].hex(), 16) # 原始crc&lt;/span&gt;&lt;br&gt;&lt;span class=&#34;line&#34;&gt;&lt;/span&gt;&lt;br&gt;&lt;span class=&#34;line&#34;&gt;&lt;/span&gt;&lt;br&gt;&lt;span class=&#34;line&#34;&gt;if crc32key == original_crc32: # 计算crc对比原始crc&lt;/span&gt;&lt;br&gt;&lt;span class=&#34;line&#34;&gt;    print(&amp;#x27;宽高没有问题!&amp;#x27;)&lt;/span&gt;&lt;br&gt;&lt;span class=&#34;line&#34;&gt;else:&lt;/span&gt;&lt;br&gt;&lt;span class=&#34;line&#34;&gt;    input_ = input(&amp;quot;宽高被改了, 是否CRC爆破宽高? (Y/n):&amp;quot;)&lt;/span&gt;&lt;br&gt;&lt;span class=&#34;line&#34;&gt;    if input_ not in [&amp;quot;Y&amp;quot;, &amp;quot;y&amp;quot;, &amp;quot;&amp;quot;]:&lt;/span&gt;&lt;br&gt;&lt;span class=&#34;line&#34;&gt;        exit()&lt;/span&gt;&lt;br&gt;&lt;span class=&#34;line&#34;&gt;    else: &lt;/span&gt;&lt;br&gt;&lt;span class=&#34;line&#34;&gt;        for i, j in itertools.product(range(4095), range(4095)): # 理论上0x FF FF FF FF，但考虑到屏幕实际/cpu，0x 0F FF就差不多了，也就是4095宽度和高度&lt;/span&gt;&lt;br&gt;&lt;span class=&#34;line&#34;&gt;            data = bin_data[12:16] + struct.pack(&amp;#x27;&amp;gt;i&amp;#x27;, i) + struct.pack(&amp;#x27;&amp;gt;i&amp;#x27;, j) + bin_data[24:29]&lt;/span&gt;&lt;br&gt;&lt;span class=&#34;line&#34;&gt;            crc32 = zlib.crc32(data)&lt;/span&gt;&lt;br&gt;&lt;span class=&#34;line&#34;&gt;            if(crc32 == original_crc32): # 计算当图片大小为i:j时的CRC校验值，与图片中的CRC比较，当相同，则图片大小已经确定&lt;/span&gt;&lt;br&gt;&lt;span class=&#34;line&#34;&gt;                print(f&amp;quot;\nCRC32: &amp;#123;hex(original_crc32)&amp;#125;&amp;quot;)&lt;/span&gt;&lt;br&gt;&lt;span class=&#34;line&#34;&gt;                print(f&amp;quot;宽度: &amp;#123;i&amp;#125;, hex: &amp;#123;hex(i)&amp;#125;&amp;quot;)&lt;/span&gt;&lt;br&gt;&lt;span class=&#34;line&#34;&gt;                print(f&amp;quot;高度: &amp;#123;j&amp;#125;, hex: &amp;#123;hex(j)&amp;#125;&amp;quot;)&lt;/span&gt;&lt;br&gt;&lt;span class=&#34;line&#34;&gt;                exit(0)&lt;/span&gt;&lt;br&gt;&lt;span class=&#34;line&#34;&gt;&lt;/span&gt;&lt;br&gt;&lt;/pre&gt;&lt;/td&gt;&lt;/tr&gt;&lt;/table&gt;&lt;/figure&gt;
